import React, { Component } from 'react';
import { Tabs, Tab, Grid, Cell, Card, CardTitle, CardText, CardActions, Button, CardMenu, IconButton } from 'react-mdl';
import {Animation} from 'mdbreact';
import Stock from './stock';
import Carda from './card';

class Projects extends Component {
  constructor(props) {
    super(props);
    this.state = { 
      activeTab: 0,
      isOpen: false,
      whichModal: ""
    };
  }

  toggleModal = (e) =>{
    console.log(e.target)
    this.setState({
      isOpen: !this.state.isOpen,
      whichModal: e.target.whichone
    });
    console.log(this.state.whichModal)
  }

  toggleCategories() {

    if(this.state.activeTab === 0){
      return(
        <Animation type="fadeInLeft" >
        <Stock show={this.state.isOpen} onClose={this.toggleModal} which={this.state.whichModal}>Heres your sexy ass Modal</Stock>
        <Carda></Carda> 
        <Carda></Carda> 
        </Animation>
      )
    } else if(this.state.activeTab === 1) {
      return (
        <div><h1>This is React</h1></div>
      )
    } else if(this.state.activeTab === 2) {
      return (
        <div><h1>This is JavaScript</h1></div>
      )
    } else if(this.state.activeTab === 3) {
      return (
        <div><h1>This is Python</h1></div>
      )
    }else if(this.state.activeTab === 4) {
        return (
          <div><h1>This is Tableau</h1></div>
        )
      }else if(this.state.activeTab === 5) {
        return (
          <div><h1>This is MySQL</h1></div>
        )
      }
  }
  render() {
    return(
      <div>
        <Tabs activeTab={this.state.activeTab} onChange={(tabId) => this.setState({ activeTab: tabId })} ripple>
          <Tab>Featured Projects</Tab>
          <Tab>React</Tab>
          <Tab>JavaScript</Tab>
          <Tab>Python</Tab>
          <Tab>Tableau</Tab>
          <Tab>MySQL</Tab>
        </Tabs>
          <Grid>
            <Cell col={12}>
              <div className="content">{this.toggleCategories()}</div>
            </Cell>
          </Grid>
      </div>
    )
  }
}
export default Projects;
